import "./DummyObjectivePage.css";
import Navbar from "../components/Navbar";
import Carousel from "../components/Carousel";

function DummyObjectivePage() {
    return (
        <div>
            <section>
                <div className="row">
                    <Navbar />
                </div>
                <div className="row container-fluid">
                    <Carousel />
                </div>
            </section>
        </div>
    );
}

export default DummyObjectivePage;
